	SET NOCOUNT ON;
	
	--' 오프라인강의 수료여부 확인하여 회기연도에 30개 이상 수료하면 스탬프 부여함
	INSERT INTO LMSSTAMPOBTAIN (
		UID
		, STAMPID
		, OBTAINSEQ
