/****** Object:  StoredProcedure [dbo].[SP_LMS_STAMPREGULAR]    Script Date: 2016-08-23 오후 1:43:39 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- =============================================
-- Author:		<Author,,Name>
-- Create date: <Create Date,,>
-- Description:	<Description,정규과정스탬프,>
-- =============================================
CREATE PROCEDURE [dbo].[SP_LMS_STAMPREGULAR] 
@UID VARCHAR(11),
@COURSEID VARCHAR(10),
@RETURN VARCHAR(2) OUT
AS
BEGIN
	SET NOCOUNT ON;
	
	DECLARE @STAMPFLAG VARCHAR(1)
	DECLARE @STAMPID INT

	--'정규과정을 읽어서 스탬프 발행여부 확인하여 스탬프 발행 없으면 종료함
	SELECT 
		@STAMPFLAG = STAMPFLAG
		, @STAMPID = STAMPID
	FROM LMSREGULAR
	WHERE COURSEID = @COURSEID
	
	IF @STAMPFLAG = 'Y'
		BEGIN
			--' 정규과정 스탬프 있는지 확인하여 없으면 스탬프 발행함
			INSERT INTO LMSSTAMPOBTAIN (
				UID
				, STAMPID
				, OBTAINSEQ
				, OBTAINDATE
				, COURSEID
			)
			SELECT 
				@UID
				, @STAMPID
				, (SELECT ISNULL(MAX(OBTAINSEQ),0) +1 FROM LMSSTAMPOBTAIN WHERE UID = @UID AND STAMPID = @STAMPID)
				, GETDATE()
				, @COURSEID
			WHERE 0 = (
				SELECT COUNT(*)
				FROM LMSSTAMPOBTAIN
				WHERE UID = @UID
				AND STAMPID = @STAMPID
				AND COURSEID = @COURSEID
			)
		END

	IF @@ERROR <> 0
		SET @RETURN = 'ER'
	ELSE 
		SET @RETURN = 'OK'

	SELECT @RETURN;
END

GO
/****** Object:  StoredProcedure [dbo].[SP_LMS_STAMPVIEWLOG]    Script Date: 2016-08-23 오후 1:43:39 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- =============================================
-- Author:		<Author,,Name>
-- Create date: <Create Date,,>
-- Description:	<Description,SNS공유 스탬프,>
-- =============================================
CREATE PROCEDURE [dbo].[SP_LMS_STAMPVIEWLOG] 
@UID VARCHAR(11),
@STAMPID VARCHAR(5),
@RETURN VARCHAR(2) OUT
AS
BEGIN
	SET NOCOUNT ON;
	
	--' SNS공유여부 확인하여 회기연도에 100개 이상 수료하면 스탬프 부여함
	INSERT INTO LMSSTAMPOBTAIN (
		UID
		, STAMPID
		, OBTAINSEQ
		, OBTAINDATE
		, COURSEID
	)
	SELECT 
		@UID
		, @STAMPID
		, (SELECT ISNULL(MAX(OBTAINSEQ),0) +1 FROM LMSSTAMPOBTAIN WHERE UID = @UID AND STAMPID = @STAMPID)
		, GETDATE()
		, 0
	WHERE DBO.F_LMS_DFYEAR(GETDATE()) <> DBO.F_LMS_DFYEAR(ISNULL(
		(SELECT MAX(OBTAINDATE)
			FROM LMSSTAMPOBTAIN
			WHERE UID = @UID
			AND STAMPID = @STAMPID
		),DATEADD(YEAR, -1, GETDATE()))
	)
	AND 100 = ISNULL((
		SELECT SUM(ISNULL(VIEWCOUNT,0))
		FROM LMSVIEWLOG
		WHERE UID = @UID
		AND VIEWTYPE = '1'
		AND DBO.F_LMS_DFYEAR(CONVERT(DATETIME, SUBSTRING(VIEWMONTH,1,4) + '-' + SUBSTRING(VIEWMONTH,5,2) + '-01 00:00')) = DBO.F_LMS_DFYEAR(GETDATE())
	),0)
	
	IF @@ERROR <> 0
		SET @RETURN = 'ER'
	ELSE 
		SET @RETURN = 'OK'

	SELECT @RETURN;
END

GO
