/* =======================================================
함수명 : F_LMS_AGE
생년월일로 나이 가져오기(주민번호?)
========================================================== */
CREATE FUNCTION [dbo].[F_LMS_AGE] (
              @ssn1     VARCHAR(15) ,
			  @ssn2		VARCHAR(15)
              )
RETURNS INT
AS  
BEGIN 
	DECLARE @return INT;
	DECLARE @year1 INT;
	DECLARE @year2 INT;
	DECLARE @gubun INT;
	DECLARE @nowyear INT;
		
	SET @year1 = 999;
	SET @year2 = 999;

	SET @gubun = SUBSTRING(@ssn1, 7, 1) % 2; 
	SET @nowyear = YEAR(GETDATE());
	
	IF (LEN(@ssn1) >= 7)
		BEGIN
			SET @year1 = LEFT(@ssn1, 2);
			SET @gubun = SUBSTRING(@ssn1, 7, 1); 
			IF (@gubun IN (1, 2, 5, 6))
				BEGIN
					SET @year1 = @nowyear - (1900 + @year1) - 1;
				END
			ELSE
				BEGIN
					SET @year1 = @nowyear - (2000 + @year1) - 1;
				END
		END

	IF (LEN(@ssn2) >= 7)
		BEGIN
			SET @year2 = LEFT(@ssn2, 2);
			SET @gubun = SUBSTRING(@ssn2, 7, 1); 
			IF (@gubun IN (1, 2, 5, 6))
				BEGIN
					SET @year2 = @nowyear - (1900 + @year2) - 1;
				END
			ELSE
				BEGIN
					SET @year2 = @nowyear - (2000 + @year2) - 1;
				END
		END

	IF (@year1 <= @year2)
		BEGIN
			SET @return = @year1;
		END
	ELSE
		BEGIN
			SET @return = @year2;
		END

	RETURN @return

END
;

GO
