/* =======================================================
함수명 : F_LMS_DFYEAR
입력일의 회기연도를 리턴한다.
========================================================== */
CREATE FUNCTION [dbo].[F_LMS_DFYEAR] (
	@idate    datetime 
)
RETURNS CHAR(4)  
AS  
BEGIN 
	DECLARE @PFYEAR CHAR(4)
	
	SELECT
		@PFYEAR = CASE WHEN DATEPART(MONTH,@idate) >= 9 THEN DATEPART(YEAR,@idate) + 1 
		ELSE DATEPART(YEAR,@idate) END

	RETURN @PFYEAR
END
;
