CREATE VIEW [dbo].[V_TRFEETARGET]
AS
SELECT   A.GIVEYEAR
       , A.GIVEMONTH
       , A.DEPABO_NO
       , C.NAME AS DEPABONAME
       , A.DEPCODE
       , A.CODE
       , A.BR
       , A.DEPARTMENT
       , A.GROUPCODE
       , C.GROUPS
       , C.HIGHESTACHIEVE
       , C.LOANAMEKOR
       , C.LOANAMEENG
       , C.QUALIFYDIA
       , A.AUTHGROUP
       , A.AUTHPERSON
       , A.AUTHMANAGEFLAG
       , A.DELEGTYPECODE
       , SUM(A.TRFEE) AS TRFEE
       , A.NOTE
       , A.PROCESSSTATUS
       , A.PROCESSSTATUSDT
       , A.REJECTTEXT
 FROM   DBO.TRFEETARGETMONTH A
 JOIN   DBO.TRFEETARGETMONTH B on A.GIVEYEAR = B.GIVEYEAR
                               and A.GIVEMONTH = B.GIVEMONTH
                               and A.ABO_NO = B.DEPABO_NO
 JOIN   DBO.MEMBER C ON C.UID = A.DEPABO_NO
GROUP BY A.GIVEYEAR
       , A.GIVEMONTH
       , A.DEPABO_NO
       , C.NAME
       , A.DEPCODE
       , A.CODE
       , A.BR
       , A.DEPARTMENT
       , A.GROUPCODE
       , C.GROUPS
       , C.HIGHESTACHIEVE
       , C.LOANAMEKOR
       , C.LOANAMEENG
       , C.QUALIFYDIA
       , A.AUTHGROUP
       , A.AUTHPERSON
       , A.AUTHMANAGEFLAG
       , A.DELEGTYPECODE
       , A.NOTE
       , A.PROCESSSTATUS
       , A.PROCESSSTATUSDT
       , A.REJECTTEXT
GO
