INSERT [dbo].[TRFEEAGREEMANAGE] ([FISCALYEAR], [AGREEID], [AGREETYPECODE], [DELEGTYPECODE], [AGREETITLE], [AGREETEXT], [MODIFIER], [MODIFYDATE], [REGISTRANT], [REGISTRANTDATE]) VALUES (N'2016', CAST(2.00 AS Numeric(5, 2)), N'100', N'', N'교육비 서약서 테스트 입력', N'&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;h2 style=&quot;color: rgb(82, 139, 44); padding-bottom: 25px; font-size: 24px;&quot;&gt;여행 떠나기&lt;/h2&gt;&lt;p&gt;우리는 종종 인생을 여행에 비유하곤 합니다.&lt;br&gt;하지만 오히려 방랑에 가깝다고 해야 할 것입니다.&amp;nbsp;&amp;nbsp;&lt;br&gt;&lt;br&gt;많은 사람들이 여행의 목적지조차&lt;br&gt; 모른 채 헤매고 있기 때문입니다.&amp;nbsp;&amp;nbsp;&lt;br&gt;&lt;br&gt;방랑자들은 정처 없이 발걸음을 옮기지만&lt;br&gt; 여행자들은 각자의 목적지를&lt;br&gt; 마음속에 품고 있습니다.&amp;nbsp;&amp;nbsp;&lt;br&gt;&lt;br&gt;우리가 누구이며 왜 살고 있는지,&lt;br&gt;이에 대해 명확한 해답을 가지고 있다면&lt;br&gt; 우리의 인생은 방랑이 아니라 여행입니다.&amp;nbsp;&amp;nbsp;&lt;br&gt;&amp;nbsp;&lt;/p&gt;', NULL, CAST(0xB03B0B00 AS Date), NULL, CAST(0xB03B0B00 AS Date))
INSERT [dbo].[TRFEEAGREEMANAGE] ([FISCALYEAR], [AGREEID], [AGREETYPECODE], [DELEGTYPECODE], [AGREETITLE], [AGREETEXT], [MODIFIER], [MODIFYDATE], [REGISTRANT], [REGISTRANTDATE]) VALUES (N'2016', CAST(3.00 AS Numeric(5, 2)), N'300', N'', N'교육비 제3자 동의서 테스트', N'&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;h2 style=&quot;color: rgb(82, 139, 44); padding-bottom: 25px; font-size: 24px;&quot;&gt;지구인에게 드리는 노래&lt;/h2&gt;&lt;p&gt;하늘의 별을 보았나요?&lt;br&gt;별을 느끼고 있나요?&amp;nbsp;&amp;nbsp;&lt;br&gt;&lt;br&gt;반짝이는 별 속에 그대 꿈이 있어요.&lt;br&gt;반짝이는 별 속에 희망이 있어요.&lt;br&gt;반짝이는 별 속에 우리의 노래가 있어요.&amp;nbsp;&amp;nbsp;&lt;br&gt;&lt;br&gt;별은 당신에게 끊임없이 속삭이고 있어요.&lt;br&gt;우리는 하나이고 같은 시간과 공간 속에&lt;br&gt; 존재하는 가족이고 친구라고.&amp;nbsp;&amp;nbsp;&lt;br&gt;&lt;br&gt;그리고 함께 사랑을 나누자고 사랑을 나누자고&lt;br&gt; 희망을 노래하자고 속삭이고 있어요.&amp;nbsp;&amp;nbsp;&lt;br&gt;&lt;br&gt;우리 힘을 내어 머리를 들어요.&lt;br&gt;그리고 별을 보아요.&lt;br&gt;당신을 사랑해요. 당신을 사랑해요.&amp;nbsp;&amp;nbsp;&lt;br&gt;&lt;br&gt;가슴을 활짝 열고 숨과 함께&lt;br&gt; 모든 것을 받아들여요.&lt;br&gt;별과 함께 자연과 함께 호흡해요.&lt;br&gt;하늘의 별이 항상 반짝이듯이&lt;br&gt; 당신의 영혼도 같이 빛날 거예요.&lt;br&gt;&lt;br&gt;우리는 지구시민, 지구시민, 지구시민.&lt;br&gt;지구의 별이 되고&lt;br&gt; 모두 함께 희망이 되고 꿈이 되어요.&lt;br&gt;&lt;br&gt;이 노래가 모든 지구인의 마음에&lt;br&gt; 가닿기를 바라는 마음입니다.&amp;nbsp;&lt;/p&gt;', NULL, CAST(0xB03B0B00 AS Date), NULL, CAST(0xB03B0B00 AS Date))
INSERT [dbo].[TRFEEAGREEMANAGE] ([FISCALYEAR], [AGREEID], [AGREETYPECODE], [DELEGTYPECODE], [AGREETITLE], [AGREETEXT], [MODIFIER], [MODIFYDATE], [REGISTRANT], [REGISTRANTDATE]) VALUES (N'2016', CAST(4.00 AS Numeric(5, 2)), N'200', N'2', N'다이아몬드 위임 동의서 테스트 입력', N'&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;h2 style=&quot;color: rgb(82, 139, 44); padding-bottom: 25px; font-size: 24px;&quot;&gt;내가 만드는 소리와 향기, 색깔&lt;/h2&gt;&lt;p&gt;&lt;strong&gt;&lt;font color=&quot;#528b2c&quot;&gt;&lt;span style=&quot;color: rgb(99, 99, 99);&quot;&gt;* 매주 화요일은 청년을 위해 희망을 발송합니다.&lt;/span&gt;&lt;/font&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;우리는 삶 속에서 소리와 향기, 색깔을&lt;br&gt; 끊임없이 만들어 내고 있습니다.&lt;br&gt;&lt;br&gt;소리에는 듣기 좋은 소리가 있고,&lt;br&gt;듣기 안 좋은 소리가 있습니다.&lt;br&gt;아름다운 소리가 있고, 아름답지 못한 소리가 있습니다.&lt;br&gt;건강한 소리가 있고, 건강하지 못한 소리가 있습니다.&lt;br&gt;우리는 그런 소리를 계속 내보내면서 살아갑니다.&lt;br&gt;색깔과 향기도 마찬가지입니다.&lt;br&gt;모두 생명이 들어오고 나가는 생명현상입니다.&lt;br&gt;&lt;br&gt;똑같은 물을 마셔도 소가 마시면 우유가 되고,&lt;br&gt;독사가 마시면 독이 됩니다.&lt;br&gt;같은 환경 속에서도 사람의 마음가짐에 따라&lt;br&gt; 똑같이 좋은 에너지와 기운을 받아도&lt;br&gt; 만들어 내는 것은 다릅니다.&lt;br&gt;&lt;br&gt;그 사람의 상태에 따른 것입니다.&lt;br&gt;건강의 상태, 감정의 상태&lt;br&gt; 그리고 가장 중요한 마음의 상태입니다.&lt;br&gt;&lt;br&gt;어떤 마음으로 어떻게 훈련하느냐에 따라&lt;br&gt; 거친 목소리가 진짜 아름다운 소리로 바뀝니다.&amp;nbsp;&lt;br&gt;&lt;br&gt;사람이 위대한 것은&amp;nbsp;마음가짐에 따라서&lt;br&gt; 자기의 소리도 바꿀 수 있고, 향기도 바꿀 수 있고,&lt;br&gt;색깔도 바꿀 수 있다는 것입니다.&lt;br&gt;&lt;br&gt;끊임없이 자신을 봐야 합니다.&lt;br&gt;나는 어떤 상태인가를 보고,&lt;br&gt;그것을 바꿀 것인지, 아니면 그냥 살 것인지를&lt;br&gt; 선택하는 것입니다.&amp;nbsp;&lt;/p&gt;', NULL, CAST(0xB03B0B00 AS Date), NULL, CAST(0xB03B0B00 AS Date))
INSERT [dbo].[TRFEEAGREEMANAGE] ([FISCALYEAR], [AGREEID], [AGREETYPECODE], [DELEGTYPECODE], [AGREETITLE], [AGREETEXT], [MODIFIER], [MODIFYDATE], [REGISTRANT], [REGISTRANTDATE]) VALUES (N'2016', CAST(5.00 AS Numeric(5, 2)), N'100', N'', N'교육비 서약서 테스트 입력', N'&lt;p class=&quot;mgtM ptxt&quot; style=&quot;border: 0px; line-height: 20px; color: rgb(102, 102, 102); font-family: 돋움, Dotum, 굴림, Gulim, Arial, &amp;quot;Trebuchet MS&amp;quot;, Verdana, sans-serif; margin-top: 20px !important; background-color: rgb(255, 255, 255);&quot;&gt;한국암웨이㈜로부터 다음의 기간 (2017년 2월 ~ 2017년 10월/지급기준, 즉 2016년 12월 2017년 8월/ 매출기준) 동안 본인에게 지급된&lt;br&gt;지원금 (순매출액의 2%) 에서 다음의 대상자에게 일정 금액 (대상자의 매출분에 따른 지원금)에 대한 권한을 부여 하는 것에&lt;br&gt;동의합니다.&lt;/p&gt;&lt;p class=&quot;mgtM ptxt&quot; style=&quot;border: 0px; line-height: 20px; color: rgb(102, 102, 102); font-family: 돋움, Dotum, 굴림, Gulim, Arial, &amp;quot;Trebuchet MS&amp;quot;, Verdana, sans-serif; margin-top: 20px !important; background-color: rgb(255, 255, 255);&quot;&gt;아울러, 권한 부여에 따른 지원금액은 향후 소득세 신고 시 다음의 권한을 부여 받은 ABO의 소득으로 인정됨에 동의하며, 추후&lt;br&gt;발생할 수 있는 세무상의 모든 책임은 전적으로 권한을 부여한 자와 부여 받은 자에게 있음을 인정합니다.&lt;/p&gt;&lt;p class=&quot;mgtM ptxt&quot; style=&quot;border: 0px; line-height: 20px; color: rgb(102, 102, 102); font-family: 돋움, Dotum, 굴림, Gulim, Arial, &amp;quot;Trebuchet MS&amp;quot;, Verdana, sans-serif; margin-top: 20px !important; background-color: rgb(255, 255, 255);&quot;&gt;교육비는 한국암웨이㈜가 유자격 다이아몬드 이상(권한을 부여 받은 자 포함)에게 교육을 위임함에 따라 발생하는 것으로써&lt;br&gt;지원되는 해당 금액은 교육과 관련된 용도 외에는 사용할 수 없습니다. 단, 소득세 감소 등의 사유로 권한이 부여된다고&amp;nbsp;&lt;br&gt;확인될 시에는 감사 및 조사를 통하여 지급 보류 등의 조치를 가할 수 있음에 동의하는 바입니다.&lt;/p&gt;&lt;p class=&quot;mgtM ptxt&quot; style=&quot;border: 0px; line-height: 20px; color: rgb(102, 102, 102); font-family: 돋움, Dotum, 굴림, Gulim, Arial, &amp;quot;Trebuchet MS&amp;quot;, Verdana, sans-serif; margin-top: 20px !important; background-color: rgb(255, 255, 255);&quot;&gt;이 동의서의 유효기간은 2017 회계연도에 한하며 매 회계연도 시작 시 갱신되어야 합니다. 상기 내용의 변경 및 철회 시, 변경된&amp;nbsp;&lt;br&gt;사항은 반드시 본사로 신청해 주시기 바랍니다.&lt;/p&gt;', NULL, CAST(0xB83B0B00 AS Date), NULL, CAST(0xB83B0B00 AS Date))
